const Hero = () => {
  return (
    <div className="hero">
      <p>
        Find your RPG notes in a few clicks with Note Maker, the ultimate
        companion for role-players! <br />
        <br />
        Boost your RPG experience with Note Maker! Organize your notes instantly
        and unleash your creativity.
      </p>
    </div>
  );
};

export default Hero;
